Δεδομένου ότι και μπορεί να συνεχιστεί για δέκα είκοσι χρόνια νομίζω ότι αυτό είναι λίγο γελοίο Επομένως, πρέπει να ισχύει ότι "Νομίζω ότι είναι παράλογο να διαρκεί τόσα χρόνια μία δικαστική διαμάχη."; Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Τα πετρώδη βουνά της Serra de Tramuntana εκτείνονται προς τη θάλασσα τόσο απότομα εδώ και εκεί που υπάρχουν λίγα σημεία πρόσβασης και μόνο ένα λιμάνι οποιουδήποτε μεγέθους κατά μήκος της ακτής. Επομένως, πρέπει να ισχύει ότι "Υπάρχουν 27 λιμάνια κατά μήκος των βουνών"; Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Με άλλα λόγια, όταν τα υπάρχοντα περιουσιακά στοιχεία των νοικοκυριών αυξάνονται σε αξία, οι άνθρωποι μπορούν να εξοικονομήσουν λιγότερα από το τρέχον εισόδημα και ακόμα να επιτύχουν το στόχο τους για πλούσιο εισόδημα. Επομένως, πρέπει να ισχύει ότι "Είναι συνετό να συνεχίσετε να εξοικονομείτε το ίδιο ποσό όπως πάντα."; Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Απίστευτο! Ίσως θα μπορούσες να το εξηγήσεις; Πού έχει πάει ο Wolverstone; Επομένως, πρέπει να ισχύει ότι "Ο Wolverstone είναι εδώ. Δεν χρειάζονται εξηγήσεις."; Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Το Υπουργείο Εξωτερικών ζήτησε από τη Μόσχα να τροποποιήσει τη Συνθήκη Αντιβαλιστικών Πυραύλων - την οποία οι περισσότεροι υποστηρικτές της πυραυλικής άμυνας θεωρούν ξεπερασμένο δεινοσαύρο του Ψυχρού Πολέμου ούτως ή άλλως. Επομένως, πρέπει να ισχύει ότι "Η Συνθήκη ABM περιλαμβάνει την αντιπυραυλική άμυνα."; Ναι, όχι, ή ίσως;
Ναί

Δεδομένου ότι 7), και εκείνα με χαμηλή ζήτηση (κατά μέσο όρο 1.300 μονάδες την εβδομάδα) και μεγάλη διακύμανση της ζήτησης (Cv= 1.3). Επομένως, πρέπει να ισχύει ότι "Οι ομάδες χαμηλής ζήτησης και υψηλής ζήτησης είναι συνολικά είκοσι."; Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. Επομένως, πρέπει να ισχύει ότι "Δεν του μίλησα ξανά."; Ναι, όχι, ή ίσως;
